        // Helper method để tạo User với Avatar
        private void CreateUserWithRole(AppDbContext context, UserManager<ApplicationUser> userManager,
                                       string email, string password, string roleName,
                                       string firstName, string lastName, string phoneNumber, int? salary,
                                       string avatarBase64)
        {
            var identityUser = userManager.FindByEmail(email);
            if (identityUser == null)
            {
                identityUser = new ApplicationUser
                {
                    UserName = email,
                    Email = email,
                    EmailConfirmed = true,
                    PhoneNumber = phoneNumber,
                    PhoneNumberConfirmed = true
                };
                var result = userManager.Create(identityUser, password);
                if (result.Succeeded)
                {
                    userManager.AddToRole(identityUser.Id, roleName);
                    var systemUser = new SystemUser
                    {
                        Username = email,
                        Password = password,
                        FirstName = firstName,
                        LastName = lastName,
                        Email = email,
                        PhoneNumber = phoneNumber,
                        Role = roleName,
                        Salary = salary,
                        Avatar = avatarBase64 // Gán Avatar
                    };
                    context.SystemUsers.AddOrUpdate(u => u.Username, systemUser);
                    System.Diagnostics.Debug.WriteLine($"'{roleName}' User '{email}' created successfully.");
                }
                else { System.Diagnostics.Debug.WriteLine($"Error creating '{roleName}' User '{email}': " + string.Join(", ", result.Errors)); }
            }
            else
            {
                System.Diagnostics.Debug.WriteLine($"'{roleName}' User '{email}' already exists.");
                var existingSystemUser = context.SystemUsers.Find(email);
                if (existingSystemUser == null)
                {
                    var systemUser = new SystemUser { Username = email, Password = password, FirstName = firstName, LastName = lastName, Email = email, PhoneNumber = phoneNumber, Role = roleName, Salary = salary, Avatar = avatarBase64 };
                    context.SystemUsers.AddOrUpdate(u => u.Username, systemUser);
                    System.Diagnostics.Debug.WriteLine($"Added missing SystemUser for existing Identity User '{email}'.");
                }
                else
                {
                    // Cập nhật thông tin cơ bản và avatar nếu đang trống
                    existingSystemUser.Role = roleName;
                    existingSystemUser.FirstName = firstName;
                    existingSystemUser.LastName = lastName;
                    existingSystemUser.PhoneNumber = phoneNumber;
                    existingSystemUser.Salary = salary;
                    if (string.IsNullOrEmpty(existingSystemUser.Avatar))
                    {
                        existingSystemUser.Avatar = avatarBase64;
                    }
                    System.Diagnostics.Debug.WriteLine($"Updated SystemUser info for '{email}'.");
                }

                // Đảm bảo role chính xác
                if (!userManager.IsInRole(identityUser.Id, roleName))
                {
                    var currentRoles = userManager.GetRoles(identityUser.Id);
                    if (currentRoles.Any()) userManager.RemoveFromRoles(identityUser.Id, currentRoles.ToArray());
                    userManager.AddToRole(identityUser.Id, roleName);
                    System.Diagnostics.Debug.WriteLine($"Ensured Identity Role '{roleName}' for User '{email}'.");
                }
            }
        }

        // Helper method SaveChangesWithLogging
        private void SaveChangesWithLogging(AppDbContext context, string stage)
        {
            try
            {
                context.SaveChanges();
                System.Diagnostics.Debug.WriteLine($"Successfully saved changes for stage: {stage}");
            }
            catch (DbEntityValidationException dbEx)
            {
                System.Diagnostics.Debug.WriteLine($"DbEntityValidationException during Seed stage '{stage}':");
                foreach (var validationErrors in dbEx.EntityValidationErrors)
                {
                    foreach (var validationError in validationErrors.ValidationErrors)
                    {
                        System.Diagnostics.Debug.WriteLine($"  Entity: {validationErrors.Entry.Entity.GetType().Name}, Property: {validationError.PropertyName}, Error: {validationError.ErrorMessage}");
                    }
                }
                throw;
            }
            catch (Exception ex)
            {
                System.Diagnostics.Debug.WriteLine($"Generic Exception during Seed stage '{stage}': {ex}");
                if (ex.InnerException != null) System.Diagnostics.Debug.WriteLine($"  Inner Exception: {ex.InnerException}");
                throw;
            }
        }
    }
}